/** @format */
import React from "react";
import Book from "./book";

export default class Booklist extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      books: [
        {
          title: "How to code",
          author: "Mark Marky",
          isbn: "22323222"
        },
        {
          title: "how to make a booklist app",
          author: "octavian david",
          isbn: "23223223"
        }
      ]
    };

    this.state.books.forEach(book => {
      console.log(book);
    });
  }

  render() {
    return (
      <div className="booklist-section">
        <div className="booklist-container">
          <table>
            <thead>
              <tr id="table-headers">
                <th>Title</th>
                <th>Author</th>
                <th>ISBN</th>
                <th></th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>History of Humankind</td>
                <td>Goerge Best</td>
                <td>2312022</td>
                <td>X</td>
              </tr>
            </tbody>
          </table>
        </div>
      </div>
    );
  }
}
